import { Link } from "react-router-dom";
import Header from "./navigation";


export default function Signup() {
    return (
        <div id="signup-page">
            <Link to="/"><img src="./LOGO-H 1.png" id="signup-logo"></img></Link>
            <div>
                <h1>We Solve Misinformation in The Best Way for People.</h1>
                <h3>We've done it carefully and simply. Combined with the ingredients makes for beautiful landings. 
                    It is definitely the tool you need to speed up your design process.</h3>
            </div>

        </div>
    )
}
